import React from 'react';
import Navbar from '../navbar/Navbar';
import './home.css'

class Home extends React.Component {
	render(){
		return(
			<>
				<Navbar />
				<div className="row">
					<div className="col-3 col-6 col-md-4">
					2 of 3 (wider)
					</div>
				<div className="col-9">
					3 of 3
					</div>
				</div>
			</>
		)
	}
}

export default Home;
